import {useState} from "react";

function App({store}) {
  return (
    <>
    <p>{store.getState()}</p>
    <button onClick={() => store.dispatch({type: 'INCREMENT'})}>plus</button>
    <button onClick={() => store.dispatch({type: 'DECREMENT'})}>minus</button>
    <button onClick={() => store.dispatch({type: 'ZERO'})}>zero</button>
    </>
  );
}

export default App;
